function minOperations(nums1: number[], nums2: number[]): number {
    // Initial conditions check
    if (nums1[nums1.length - 1] === Math.max(...nums1) && nums2[nums2.length - 1] === Math.max(...nums2)) {
        return 0; // No operations needed
    }

    let operations = 0;
    const n = nums1.length;
    let max1 = Math.max(...nums1);
    let max2 = Math.max(...nums2);

    // Perform operations
    for (let i = 0; i < n; i++) {
        if (nums1[i] !== nums2[i]) {
            let potentialMax1 = nums1[n - 1] === max1 ? max1 : Math.max(max1, nums2[i]);
            let potentialMax2 = nums2[n - 1] === max2 ? max2 : Math.max(max2, nums1[i]);
            if (potentialMax1 > max1 || potentialMax2 > max2) {
                [nums1[i], nums2[i]] = [nums2[i], nums1[i]];
                operations++;
                max1 = Math.max(...nums1);
                max2 = Math.max(...nums2);
                if (nums1[n - 1] === max1 && nums2[n - 1] === max2) {
                    return operations; // Both conditions are satisfied
                }
            }
        }
    }

    // Final check after attempting swaps
    if (nums1[n - 1] === Math.max(...nums1) && nums2[n - 1] === Math.max(...nums2)) {
        return operations;
    }

    return -1; // If conditions cannot be satisfied
}
